const About = () => {
  return (
    <section>
      <div>
        <h6>Peter Awotola</h6>
        <h1>
          Frontend Developer<span>.</span>{" "}
        </h1>
        <p>I love to build products for the web.</p>
        <div>
          <p>
            Highly skilled at building fast, high performant web application
          </p>
          <p>Specialized in creating things useful in the society.</p>
        </div>
      </div>
    </section>
  );
};

export default About;
